import React from 'react';
import { faEllipsisV } from '@fortawesome/free-solid-svg-icons';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';

const Navigation = () => (
  <FontAwesomeIcon
    icon={faEllipsisV}
    size={'2x'}
    style={{ cursor: 'pointer' }}
  />
);

export default Navigation;
